import React from "react";

const BlockNumber = () => {
  return (
    <div
      style={{
        display: "flex",
        position: "absolute",
        right: "32px",
        bottom: "24px",
        color: "#52C41A",
      }}
    >
      <p style={{ marginRight: "8px" }}>Block Number</p>
      <img src="/status-dot.svg" />
    </div>
  );
};

export default BlockNumber;
